import { Grid } from '@material-ui/core';
import React from 'react';

import { sections } from '../../src/directory.data';

export const HomePage = () => {
  return (
    <Grid container>
      {sections.map((sec) => (
        <Grid key={sec.id} item sm={4} justify='center'>
          {sec.title}
        </Grid>
      ))}
    </Grid>
  );
};
